INSERT INTO "Posts" VALUES (20,123459,'סוגי ברגים','28.06.2020',13,10,1,'אפשר לחלק את סוגי הברגים ל-3 קבוצות בהתאם למראה הבורג עצמו:

בורג רינג. זהו בורג נפוץ ובסיסי אשר קצהו שטוח. זהו בורג המשמש לחיזוק או להרכבה על ידי השחלה למקום המיועד להברגה וחיזוק על ידי אום מתאים. בורג זה נחשב לחזק מאד.

בורג קודח. זהו בורג עם קצה בצורת שפיץ. בגלל חוזקו הוא בשימוש נפוץ לקידוח בברזל, עץ, ואלומיניום.

בורג אלן. קיימים שני סוגים לברגים מסוג זה. האחד זהו בורג עם ראש רגיל שקצהו ישר. השני הוא בורג ללא ראש אשר שני קצותיו ישרים ולצורך סגירתו וחיזוקו דרושים אומים לשני צדדיו. בורג מסוג אלן נחשב לחזק יותר מבורג קודח או מבורג רינג פתוח.

מראה ראש הבורג

חלוקה נוספת היא בהתאם לחריצים המופיעים על גבי ראש הבורג:

בורג פיליפס עם חריץ בצורת צלב.
בורג טורקס עם חריץ בצורת כוכב.
בורג אלן אשר השקע שלו נראה כמשושה.
בורג בעל חריץ אחד בצורת קו ישר.
בורג בעל ראש משושה אשר בולט מעל פני המשטח אליו הוא מוברג.
המברג או ראש הביט של המברגה חייב להיות בהתאמה לצורת ראש הבורג. נוכל למצוא סוגים שונים: מברג פיליפס, מברג רגיל, מפתח ברגים, בוקסה ועוד. כלים להברגה שאינם מתאימים עלולים לגרום לשחיקה של הבורג או של המכשיר המבריג. 

',X'');
INSERT INTO "Posts" VALUES (24,123456,'חיפוש בינארי ב-JAVA','28.06.2020',42,38,2,'BinarySearch(A[0..N-1], value, low, high) {  
    if (high < low)  
        return -1 // not found  
    mid = low + ((high - low) / 2) 
    if (A[mid] > value)  
        return BinarySearch(A, value, low, mid-1)  
    else if (A[mid] < value)  
        return BinarySearch(A, value, mid+1, high)  
    else
       return mid // found
    }',X'');
INSERT INTO "Posts" VALUES (28,333213,'שרב','28.06.2020',20,15,4,'שרב ההסעה הוא השכיח ביותר בישראל בעונות המעבר. שרב כזה מאופיין בזרימות דרומיות ומזרחיות בד"כ שמביאות עימן אוויר חם מהמדבריות. היות שבמדבר אין לחות – האוויר שמגיע הוא יבש מאוד. במצב כזה גם החוף מרגיש בשרב ולים כמעט אין השפעה עליו מלבד עצם היותו מקום מושלם להתקרר ולרחוץ בו בימי שרב.',X'');
